css:
.scrollable-view {
  overflow: scroll;
}
.repl-view {
  font-family: monospace;
  font-size: 14px;
  display: -webkit-flex;
  color: #444444;
  background-color: #f4f4f4;
  padding: 10px;
}
.repl-view ul {
  padding-left: 0px;
  width: 100%;
}
.repl-view li {
  list-style-type: none;
}
.repl-view ul.stacktrace li {
  color: #aaa;
}
.repl-view ul.stacktrace li.clojure {
  color: black;
}
.repl-view ul.stacktrace {
  border-left: solid red 3px;
  padding-left: 10px;
}
.clojure.discard {
  font-style: italic;
}
.debug-atom-clojure {
  padding: 10px;
  background-color: #f4f4f4;
  width: 100%;
  height: 100%;
  overflow-y: scroll;
  color: #444444;
}
.debug-atom-clojure h1 {
  margin-top: 0;
}
.repl-entry {
  border-top: solid #c3c3c3 3px;
  list-style-type: none;
  margin-bottom: 20px;
  position: relative;
  background-color: #f4f4f4;
}
.repl-entry .evald-form {
  background-color: transparent;
  padding: 5px;
}
.repl-entry .evald-form code {
  white-space: pre;
  background-color: transparent;
  color: #777;
}
.repl-entry .repl-entry-controls {
  position: absolute;
  top: 5px;
  right: 5px;
}
.repl-entry .output {
  padding: 5px;
}
.raw-output {
  width: 100%;
}
.rendered-output {
  padding: 10px;
  white-space: pre-wrap;
}
.toggle-raw {
  text-align: center;
  width: 100%;
  background-color: #f4f4f4;
  padding: 3px;
  cursor: pointer;
  font-family: sans-serif;
}
.toggle-raw:hover {
  background-color: #ffffff;
}
.connections-view {
  padding: 10px;
}
.connections-view h1 {
  margin-top: 0px;
}
.atom-styleguide-view {
  background-color: #cccccc;
  height: 100%;
  padding: 20px;
}
.atom-styleguide-view h1 {
  margin-top: 0px;
}
.styleguide-example-content {
  background-color: #eee;
  background-image: linear-gradient(45deg, #cccccc 25%, transparent 25%, transparent 75%, #cccccc 75%, #cccccc), linear-gradient(45deg, #cccccc 25%, transparent 25%, transparent 75%, #cccccc 75%, #cccccc);
  background-size: 40px 40px;
  background-position: 0 0, 20px 20px;
  padding: 20px;
}
.data {
  font-family: monospace;
  font-size: 14px;
}
.data.vector,
.data.map {
  padding: 5px;
}
.data.vector ul,
.data.map ul {
  padding-left: 10px;
}
.data.vector li,
.data.map li {
  list-style-type: none;
}
